import React, { useState } from 'react';
import './App.css';
import TimeBlockingCalendar from './components/TimeBlocking/TimeBlockingCalendar';
import EisenhowerMatrix from './components/EisenhowerMatrix/EisenhowerMatrix';
import PomodoroTimer from './components/Pomodoro/PomodoroTimer';

function App() {
  const [activeComponent, setActiveComponent] = useState('timeBlocking');

  return (
    <div className="App">
      <header className="App-header">
        <h1>Time Management App</h1>
        <nav>
          <button 
            className={activeComponent === 'timeBlocking' ? 'active' : ''} 
            onClick={() => setActiveComponent('timeBlocking')}
          >
            Time Blocking
          </button>
          <button 
            className={activeComponent === 'eisenhower' ? 'active' : ''} 
            onClick={() => setActiveComponent('eisenhower')}
          >
            Eisenhower Matrix
          </button>
          <button 
            className={activeComponent === 'pomodoro' ? 'active' : ''} 
            onClick={() => setActiveComponent('pomodoro')}
          >
            Pomodoro Timer
          </button>
        </nav>
      </header>
      <main>
        {activeComponent === 'timeBlocking' && <TimeBlockingCalendar />}
        {activeComponent === 'eisenhower' && <EisenhowerMatrix />}
        {activeComponent === 'pomodoro' && <PomodoroTimer />}
      </main>
    </div>
  );
}

export default App;
